import React from "react";
import logo from "./logo.svg";
import "./App.css";
import TechComponent from "./components/Tech";

function App() {
  return (
    <div className="App">
        <div className="top">
          <h1 className="name">Adel Jabbar</h1>
          <div>
            <img
              src="/profile.jpg"
              alt="Adel Jabbar"
              className="profilePic"
            ></img>
          </div>
          <h3 className="title">Full Stack Software Engineer</h3>

          <div className="shortBio">
            <p>
              With over 4 years of ad tech experience, I'm a Full Stack Software
              Engineer with a strong history of Client Services and Project
              Management experience in the tech industry. I love: [insert
              hobbies here]
            </p>
          </div>
        </div>
        <TechComponent />

    </div>
  );
}

export default App;
